The inputs to modkit dmr are two or more bedMethyl files (created by modkit pileup) that have been compressed with bgzip and indexed with tabix . An example workflow to generate the input data is shown below: ref=grch38.fasta
threads=32 norm=normal_sample.bam
norm_pileup=normal_pileup.bed modkit pileup ${norm} ${norm_pileup} \ --cpg \ --ref ${ref} \ --threads ${threads} \ --log-filepath log.txt bgzip ${norm_pileup}
tabix ${norm_pileup}.gz tumor=tumor_sample.bam
tumor_pileup=tumor_pileup.bed modkit pileup ${tumor} ${tumor_pileup} \ --cpg \ --ref ${ref} \ --threads ${threads} \ --log-filepath log.txt bgzip ${tumor_pileup}
tabix ${tumor_pileup}.gz
